import React, {useEffect, useState} from 'react';
import './styles.css'
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import api from '../services/api';

const useStyles = makeStyles((theme) => ({
    root: {
      '& > *': {
        margin: theme.spacing(1),
        width: '40ch',
      },
    },
  }));


export default function Playlists(){
    const classes = useStyles();

    const [playlist, setPlaylist] = useState('')
    console.log(playlist)

async function handleSearchPlaylist(event){
    event.preventDefault()
    const response = await api.post('playlist/create', {name: playlist}) 
    console.log(response)
}
    return(
        <>

            <div className="search" >
                <form onSubmit={handleSearchPlaylist} className={classes.root} noValidate autoComplete="off"> 
                     <TextField id="standard-basic" label="Busque uma playlist" 
                     onChange={(event)=>setPlaylist(event.target.value)}
                     value={playlist}
                     />
                </form>
            </div>

            <div className="list-playlist">
                <ul>
                    <li>

                    </li>
                </ul>
            </div>

        </>
    )

}
